import React from "react";
import "./sidebar.css";

export default function SidBar() {
    return (
        <div className="sidebar">
            <div className="sidebarItem">
                <span className="sidebarTitle">ABOUT ME</span>
                <img src="https://s3.amazonaws.com/shecodesio-production/uploads/files/000/126/146/original/Transparent_Logo.png?1715439255" alt="About Wild Byte"/>
                <p>
                    Wild Byte is a project that showcases stories about the natural world that can be enjoyed by everyone!
                </p>
            </div>
            <div className="sidebarItem">

            </div>
        </div>
    )
}
